import React from "react";
import "./Prodotti.css";
import Viaggi from "../Immagini/aereo.png";
import Row from 'react-bootstrap/Row'

const Prodotti = () => {
<Container>
  <Row md={4}>
    <Col>1 of 3</Col>
    <Col xs={6}>2 of 3</Col>
    <Col>3 of 3</Col>
  </Row>
</Container>
};
export default Prodotti;
